import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../../App.css';
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome';
import {faPlay, faThumbsUp, faClock} from '@fortawesome/free-solid-svg-icons';
import sampleImg from '../../assets/damon.jpg';

const Playlist = () => {
  return (
    <div className="container mt-4">
      <div className="d-flex align-items-center">
        <img src={sampleImg} alt="user" className="playlist-image mr-2" />
        <div className="d-flex flex-column">
          <span>Songs to listen while coding</span>
          <span className="text-secondary">
            <small>by Damon Joung</small>
          </span>
          <div>
            <span>
              <small>
                <FontAwesomeIcon icon={faPlay} />
                100,000
              </small>
            </span>
            <span>
              <small>
                <FontAwesomeIcon icon={faThumbsUp} />
                1,000
              </small>
            </span>
            <span>
              <FontAwesomeIcon icon={faClock} />
              2h18m
            </span>
            <span>publish date</span>
          </div>
        </div>
        <button className="btn btn-danger h-25 ml-auto px-2 py-1">Follow</button>
      </div>
    </div>
  );
};

export default Playlist;
